        let  childFamilyData= { zipData :
            {zip_code: e.target.value}
        };

        props.onSelectedChild(childFamilyData);
    };

    let formDataBuildOne = props.famData ? ((zip_code_form=props.famData.zip_code))? props.famData : '' :'';


    return (
        <div className="label-container">
